var some = require('./some');

    /**
     * Check if object contains value
     */
    /**
     * Description
     * @method contains
     * @param {} obj
     * @param {} needle
     * @return CallExpression
     */
    function contains(obj, needle) {
        return some(obj, function(val) {
            return (val === needle);
        });
    }
    module.exports = contains;


